import React from "react";
import { Box, Center, HStack, Pressable } from "native-base";

export default function App() {
  return (
    <Center h="100vh" bg="coolGray.900">
      <Box position="relative">
        <HStack mb="3" space="3">
          <Pressable>
            {({ isHovered }) => (
              <Box
                size={"150px"}
                postion="absolute"
                roundedTopLeft="full"
                bg="indigo.500:alpha.80"
                left={isHovered ? "-8px" : "0"}
                top={isHovered ? "-8px" : "0"}
              >
                <Center h="100%">About Me</Center>
              </Box>
            )}
          </Pressable>
          <Pressable>
            {({ isHovered }) => (
              <Box
                size={"150px"}
                postion="absolute"
                roundedTopRight="full"
                bg="secondary.500:alpha.80"
                right={isHovered ? "-8px" : "0"}
                top={isHovered ? "-8px" : "0"}
              >
                <Center h="100%">Blogs</Center>
              </Box>
            )}
          </Pressable>
        </HStack>
        <HStack space="3">
          <Pressable>
            {({ isHovered }) => (
              <Box
                size={"150px"}
                postion="absolute"
                roundedBottomLeft="full"
                bg="emerald.500:alpha.80"
                left={isHovered ? "-8px" : "0"}
                bottom={isHovered ? "-8px" : "0"}
              >
                <Center h="100%">Projects</Center>
              </Box>
            )}
          </Pressable>
          <Pressable>
            {({ isHovered }) => (
              <Box
                size={"150px"}
                postion="absolute"
                roundedBottomRight="full"
                bg="blue.500:alpha.80"
                right={isHovered ? "-8px" : "0"}
                bottom={isHovered ? "-8px" : "0"}
              >
                <Center h="100%">Socials</Center>
              </Box>
            )}
          </Pressable>
        </HStack>
      </Box>
    </Center>
  );
}
